import { CtButton } from '../Button/Button';
import './Card.scss';

export const CtCard = ({ data }) => {
    return (
        <div className={`${data.class} data.ct__wrap_card`}>
            <div className="ct__card_title">
                <p>{data.title}</p>
                {data.subTitle} {/** For custom link or icon */}
            </div>
            <div className="ct__card_body">
                {data.body}
            </div>
            <div className="ct__card_footer row">
                <CtButton data={{ description: 'Cancel', btnType: 'ct__btn-danger' }} />
                <CtButton data={{ description: 'Add task' }} />
            </div>
        </div>
    );
}
